    // 3. contact
    return(
        <div>
         <Navbar bg="dark" variant="dark">
    <Container>
    <Navbar.Brand href="#">
        <img src="F:\React Projects\portfolio\src\img\face.png" alt="lucas face"></img>
    </Navbar.Brand>
    <Nav className="me-auto">
      <Nav.Link href="work">Work</Nav.Link>
      <Nav.Link href="about">About</Nav.Link>
    </Nav>
    </Container>
  </Navbar>
        </div>
    );
}

export default Navigation;
